ount Name \"S M EFTIAR HOSSAIN\", Select Card, Select Bank, Select District, Select Branch, Select NPSB, Input transfer amount \"50\" below my available balance and remarks and confirm next to continue\n    Then I can see transaction details screen, select OTP channel, accept the terms and confirm next to continue by OTP verification \"1111\"\n    Then I can see transaction confirmation screen with success or fail status and the details of the transactions\n    Then I can download the transaction receipt\n    Then I can add the transaction to favourite \"OtherFT\"\n    Then I can navigate to home clicking Go To Home\n\n  Scenario: Verify Successful BFTN Account FT\n    When I navigate to \"https://abdirectcloud.abbl.com/project/bank-account\"\n    Then I navigate to my dashboard\n    Then I navigate to the Other Account Fund Transfer\n    Then I click on Continue Without Beneficiary to Transfer Money\n    Then I navigated to the transfer details screen for Other FT with a selected from account and available balance populated\n    Then I input To Account Number \"2182603692001\", To Account Name \"S M EFTIAR HOSSAIN\", Select Account, Select Bank, Select District, Select Branch, Select BEFTN, Input transfer amount \"50\" below my available balance and remarks and confirm next to continue\n    Then I can see transaction details screen, select OTP channel, accept the terms and confirm next to continue by OTP verification \"1111\"\n    Then I can see transaction confirmation screen with success or fail status and the details of the transactions\n    Then I can download the transaction receipt\n    Then I can add the transaction to favourite \"OtherFT\"\n    Then I can navigate to home clicking Go To Home\n\n  Scenario: Verify Successful BFTN Card FT\n    When I navigate to \"https://abdirectcloud.abbl.com/project/bank-account\"\n    Then I navigate to my dashboard\n    Then I navigate to the Other Account Fund Transfer\n    Then I click on Continue Without Beneficiary t /test/java/resources/features/TC007_MFSFundTransfer.feature","data":"Feature: MFS Fund Transfer\n\n  Scenario: Verify Successful bKash FT\n    When I navigate to \"https://abdirectcloud.abbl.com/project/bank-account\"\n    Then I navigate to my dashboard\n    Then I navigate to the MFS Fund Transfer\n    Then I click on Continue Without Beneficiary to Transfer Money via MFS\n    Then I navigated to the transfer details screen for MFS bKash FT with a selected from account and available balance populated\n    Then I input To Account Number \"01777666213\" for bkash, transfer amount \"50\" below my available balance and remarks and confirm next to continue\n    Then I can see transaction details screen for MFS, select OTP channel, accept the terms and click confirm to continue by OTP verification \"1111\"\n    Then I can see transaction confirmation screen with success or fail status and the details of the transactions\n    Then I can download the transaction receipt\n    Then I can add the transaction to favourite \"MFSbKash\"\n    Then I can navigate to home clicking Go To Home","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///Users/bs01099/Documents/Cucumber_maven/src/test/java/resources/features/TC007_MFSFundTransfer.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"MFS Fund Transfer","description":"","children":[{"scenario":{"location":{"line":3,"column":3},"tags":[],"keyword":"Scenario","name":"Verify Successful bKash FT","description":"","steps":[{"location":{"line":4,"column":5},"keyword":"When ","keywordType":"Action","text":"I navigate to \"https://abdirectcloud.abbl.com/project/bank-account\"","id":"79debdd7-3e54-43bf-b467-7dc37b042aa3"},{"location":{"line":5,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"I navigate to my dashboard","id":"d07a4404-39af-438d-ae1d-bb9f89ddfdfc"},{"location":{"line":6,"column":5},"keyword":"Then ","keywordType":"Outcome","tex
